import React from "react";
import { data } from "../../pages/datas/data";

const ImageSlider = () => {
  return (
    <div>
      {data.map((dat, index) => {
        return <img src={dat.pictures} alt="images" />;
      })}
    </div>
  );
};

export default ImageSlider;
